To define a function and assign it to a variable, the syntax is as follows: # Define a parameterless function named `say-hello` that prints "Hello"
[$say-hello] { Hello
} # Define a function `greet` with parameter `name` that prints a custom greeting
[$greet: name] { Hello, <name>!
} # Define a function `flip-coin` that returns the value of either `heads` and `tails`
[$flip-coin: heads; tails] { {<heads>|<tails>}
}

18.body:
A function parameter can be marked as optional using the ? symbol. When the argument is omitted for an optional parameter, it will default to the empty value <>. Please note that any optional parameters must appear after all required parameters, and before any variadic parameter. # Generates a map for a pet with a name and species (defaults to "dog")
[$gen-pet: name; species?] { @( name = <name>| species = [alt: <species>; dog] )
}

22.body:
Calling an anonymous function uses the same syntax as regular function calls, but the function name is replaced by the ! symbol followed by an expression that provides the function (or closure) you want to call. # Define a function that returns a parameterless box
[$get-anon-func] { [?]{Hello from anonymous function}
} [![get-anon-func]] # "Hello from anonymous function" # Define a function that returns a box with a single parameter
[$get-greet-func] { [?:name]{Hello, <name>!}
} [![get-greet-func]:Rant] # "Hello, Rant!"
